2899","status":"completed"},"slideshow":{"slide_type":"subslide"},"tags":[]},"source":["**Build the Model**\n","\n","Building the neural network in Keras requires configuring the layers of the model, then compiling the model.\n","\n","\n","_Setup the layers_\n","\n","The basic building block of a neural network is the layer. Layers extract representations from the data fed into them. And, hopefully, these representations are more meaningful for the problem at hand.\n","\n","Most of deep learning consists of chaining together simple layers. Most layers, like `layer_dense` and `conv_layers`, have parameters that are learned during training.\n"]},{"cell_type":"code","execution_count":17,"metadata":{"execution":{"iopub.execute_input":"2022-07-20T11:47:46.275664Z","iopub.status.busy":"2022-07-20T11:47:46.274139Z","iopub.status.idle":"2022-07-20T11:47:49.327908Z","shell.execute_reply":"2022-07-20T11:47:49.326009Z"},"papermill":{"duration":3.109809,"end_time":"2022-07-20T11:47:49.328032","exception":false,"start_time":"2022-07-20T11:47:46.218223","status":"completed"},"tags":[]},"outputs":[],"source":["model <- keras_model_sequential()\n","model %>%\n","    layer_conv_2d(filters = 32, kernel_size = c(3,3), activation = 'relu', input_shape = c(28, 28, 1)) %>%\n","    layer_max_pooling_2d(pool_size = c(2,2)) %>%\n","    layer_flatten() %>%\n","    layer_dense(units = 128, activation = 'relu') %>%\n","    layer_dropout(rate = 0.5) %>%\n","    layer_dense(units = 10, activation = 'softmax')"]},{"cell_type":"code","execution_count":18,"metadata":{"execution":{"iopub.execute_input":"2022-07-20T11:47:49.439815Z","iopub.status.busy":"2022-07-20T11:47:49.438193Z","iopub.status.idle":"2022-07-20T11:47:49.456515Z","shell.execute_reply":"2022-07-20T11:47:49.454838Z"},"papermill":{"duration":0.075073,"end_time":"2022-07-20T11:47:49.456658","exception":false,"start_time":"2022-07-20T11:47:49.381585","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","tex