nt to minimize this function to \"steer\" the model in the right direction.\n","- __Optimizer__ - This is how the model is updated based on the data it sees and its loss function.\n","- __Metrics__ - Used to monitor the training and testing steps. The following example uses accuracy, the fraction of the images that are correctly classified."]},{"cell_type":"code","execution_count":19,"metadata":{"execution":{"iopub.execute_input":"2022-07-20T11:47:49.684551Z","iopub.status.busy":"2022-07-20T11:47:49.683095Z","iopub.status.idle":"2022-07-20T11:47:49.731422Z","shell.execute_reply":"2022-07-20T11:47:49.729916Z"},"papermill":{"duration":0.105519,"end_time":"2022-07-20T11:47:49.731529","exception":false,"start_time":"2022-07-20T11:47:49.62601","status":"completed"},"tags":[]},"outputs":[],"source":["model %>% compile(\n","    loss = 'sparse_categorical_crossentropy',\n","    optimizer = 'adam', \n","    metrics = c('accuracy')\n",") "]},{"cell_type":"markdown","metadata":{"papermill":{"duration":0.071502,"end_time":"2022-07-20T11:47:49.856192","exception":false,"start_time":"2022-07-20T11:47:49.78469","status":"completed"},"tags":[]},"source":["**Loss Functions and Optimizers**"]},{"cell_type":"markdown","metadata":{"papermill":{"duration":0.056035,"end_time":"2022-07-20T11:47:49.966272","exception":false,"start_time":"2022-07-20T11:47:49.910237","status":"completed"},"tags":[]},"source":["\n","![3blue1brown video edited by Caspar Hansen](https://mlfromscratch.com/content/images/2019/12/gradient-descent-optimized--1-.gif)\n","\n","Source: 3blue1brown video annotated by [mlfromscratch](https://mlfromscratch.com/optimizers-explained/#/)\n","\n","\n","![Comparison of many optimizers. Credits to Ridlo Rahman](https://mlfromscratch.com/content/images/2019/12/saddle.gif)\n","\n","Comparison of many optimizers. Credits to [Ridlo Rahman](https://rnrahman.com/blog/visualising-stochastic-optimisers/)"]},{"cell_type":"markdown","metadata":{"papermill":{"duration":0.052875,"end_time