e and negative reviews.\n","\n","Based on https://keras.rstudio.com/articles/tutorial_basic_text_classification.html\n","\n","**Download the IMDB dataset**\n","\n","The IMDB dataset comes packaged with Keras. It has already been preprocessed such that the reviews (sequences of words) have been converted to sequences of integers, where each integer represents a specific word in a dictionary.\n","\n","The following code downloads the IMDB dataset (again, ___Internet___ must be switched on in the Kaggle Notebook Settings)"]},{"cell_type":"code","execution_count":31,"metadata":{"execution":{"iopub.execute_input":"2022-07-20T11:48:49.430373Z","iopub.status.busy":"2022-07-20T11:48:49.428747Z","iopub.status.idle":"2022-07-20T11:48:55.395106Z","shell.execute_reply":"2022-07-20T11:48:55.393791Z"},"papermill":{"duration":6.031952,"end_time":"2022-07-20T11:48:55.395281","exception":false,"start_time":"2022-07-20T11:48:49.363329","status":"completed"},"tags":[]},"outputs":[],"source":["imdb <- dataset_imdb(num_words = 10000)\n","\n","c(train_data, train_labels) %<-% imdb$train\n","c(test_data, test_labels) %<-% imdb$test"]},{"cell_type":"markdown","metadata":{"papermill":{"duration":0.062155,"end_time":"2022-07-20T11:48:55.520698","exception":false,"start_time":"2022-07-20T11:48:55.458543","status":"completed"},"tags":[]},"source":["The argument num_words = 10000 keeps the top 10,000 most frequently occurring words in the training data. The rare words are discarded to keep the size of the data manageable.\n","\n","Conveniently, the dataset comes with an index mapping words to integers, which has to be downloaded separately:"]},{"cell_type":"code","execution_count":32,"metadata":{"execution":{"iopub.execute_input":"2022-07-20T11:48:55.650481Z","iopub.status.busy":"2022-07-20T11:48:55.648851Z","iopub.status.idle":"2022-07-20T11:48:55.822869Z","shell.execute_reply":"2022-07-20T11:48:55.821541Z"},"papermill":{"duration":0.239174,"end_time":"2022-07-20T11:48:55.822979","exception":f