":[],"source":["train_data <- pad_sequences(\n","  train_data,\n","  value = word_index_df %>% filter(word == \"<PAD>\") %>% select(idx) %>% pull(),\n","  padding = \"post\",\n","  maxlen = 256\n",")\n","\n","test_data <- pad_sequences(\n","  test_data,\n","  value = word_index_df %>% filter(word == \"<PAD>\") %>% select(idx) %>% pull(),\n","  padding = \"post\",\n","  maxlen = 256\n",")"]},{"cell_type":"markdown","metadata":{"papermill":{"duration":0.065639,"end_time":"2022-07-20T11:49:00.315844","exception":false,"start_time":"2022-07-20T11:49:00.250205","status":"completed"},"tags":[]},"source":["Let‚Äôs look at the length of the examples now:"]},{"cell_type":"code","execution_count":39,"metadata":{"execution":{"iopub.execute_input":"2022-07-20T11:49:00.451711Z","iopub.status.busy":"2022-07-20T11:49:00.450271Z","iopub.status.idle":"2022-07-20T11:49:00.476626Z","shell.execute_reply":"2022-07-20T11:49:00.475465Z"},"papermill":{"duration":0.095846,"end_time":"2022-07-20T11:49:00.476718","exception":false,"start_time":"2022-07-20T11:49:00.380872","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["256"],"text/latex":["256"],"text/markdown":["256"],"text/plain":["[1] 256"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["256"],"text/latex":["256"],"text/markdown":["256"],"text/plain":["[1] 256"]},"metadata":{},"output_type":"display_data"}],"source":["length(train_data[1, ])\n","length(train_data[2, ])"]},{"cell_type":"markdown","metadata":{"papermill":{"duration":0.072584,"end_time":"2022-07-20T11:49:00.616878","exception":false,"start_time":"2022-07-20T11:49:00.544294","status":"completed"},"tags":[]},"source":["**Build the model**\n","\n","The neural network is created by stacking layers ‚Äî this requires two main architectural decisions:\n","\n","- How many layers to use in the model?\n","- How many hidden units to use for each layer?\n","\n","In this example, the input data consists of an array of word-indices. The labels to predict are either 0 or 1. Let‚Äôs build a model for this problem:"]},{"cell_type":"code","execution_count":40,"metadata":{"execution":{"iopub.execute_input":"2022-07-20T11:49:00.755338Z","iopub.status.busy":"2022-07-20T11:49:00.753757Z","iopub.status.idle":"2022-07-20T11:49:00.819782Z","shell.execute_reply":"2022-07-20T11:49:00.817611Z"},"papermill":{"duration":0.13585,"end_time":"2022-07-20T11:49:00.819909","exception":false,"start_time":"2022-07-20T11:49:00.684059","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["Model: \"sequential_1\"\n","________________________________________________________________________________\n","Layer (type)                        Output Shape                    Param #     \n","================================================================================\n","embedding (Embedding)               (None, None, 16)                160000      \n","________________________________________________________________________________\n","global_average_pooling1d (GlobalAve (None, 16)                      0           \n","________________________________________________________________________________\n","dense_2 (Dense)                     (None, 16)                      272         \n","________________________________________________________________________________\n","dense_3 (Dense)                     (None, 1)                       17          \n","================================================================================\n","Total params: 160,289\n","Trainable params: 160,289\n","Non-trainable params: 0\n","________________________________________________________________________________\n"]}],"source":["# input shape is the vocabulary count used for the movie reviews (10,000 words)\n","vocab_size <- 10000\n","\n","model <- keras_model_sequential()\n","model %>% \n","  layer_embedding(input_dim = vocab_size, output_dim = 16) %>%\n","  layer_global_average_pooling_1d() %>%\n","  layer_dense(units = 16, activation = \"relu\") %>%\n","  layer_dense(units = 1, activation = \"sigmoid\")\n","\n","model %>% summary()"]},{"cell_type":"markdown","metadata":{"papermill":{"duration":0.06678,"end_time":"2022-07-20T11:49:00.95497","exception":false,"start_time":"2022-07-20T11:49:00.88819","status":"completed"},"tags":[]},"source":["**Additional Model Information**\n","\n","The layers are stacked sequentially to build the classifier:\n","\n","- The first layer is an embedding layer. This layer takes the integer-encoded vocabulary and looks up the embedding vector for each word-index. These vectors are learned as the model trains. The vectors add a dimension to the output array. The resulting dimensions are: (batch, sequence, embedding).\n","- Next, a global_average_pooling_1d layer returns a fixed-length output vector for each example by averaging over the sequence dimension. This allows the model to handle input of variable length, in the simplest way possible.\n","- This fixed-length output vector is piped through a fully-connected (dense) layer with 16 hidden units.\n","- The last layer is densely connected with a single output node. Using the sigmoid activation function, this value is a float between 0 and 1, representing a probability, or confidence level.\n","\n","__Hidden units__\n","The above model has two intermediate or ‚Äúhidden‚Äù layers, between the input and output. The number of outputs (units, nodes, or neurons) is the dimension of the representational space for the layer. In other words, the amount of freedom the network is allowed when learning an internal representation.\n","\n","If a model has more hidden units (a higher-dimensional representation space), and/or more layers, then the network can learn more complex representations. However, it makes the network more computationally expensive and may lead to learning unwanted patterns ‚Äî patterns that improve performance on training data but not on the test data. This is called overfitting, and we‚Äôll explore it later.\n","\n","__Loss function and optimizer__\n","A model needs a loss function and an optimizer for training. Since this is a binary classification problem and the model outputs a probability (a single-unit layer with a sigmoid activation), we‚Äôll use the binary_crossentropy loss function.\n","\n","This isn‚Äôt the only choice for a loss function, you could, for instance, choose mean_squared_error. But, generally, binary_crossentropy is better for dealing with probabilities ‚Äî it measures the ‚Äúdistance‚Äù between probability distributions, or in our case, between the ground-truth distribution and the predictions.\n","\n","\n","Now, configure the model to use an optimizer and a loss function:"]},{"cell_type":"code","execution_count":41,"metadata":{"execution":{"iopub.execute_input":"2022-07-20T11:49:01.096045Z","iopub.status.busy":"2022-07-20T11:49:01.094553Z","iopub.status.idle":"2022-07-20T11:49:01.139913Z","shell.execute_reply":"2022-07-20T11:49:01.138712Z"},"papermill":{"duration":0.117055,"end_time":"2022-07-20T11:49:01.140007","exception":false,"start_time":"2022-07-20T11:49:01.022952","status":"completed"},"tags":[]},"outputs":[],"source":["model %>% compile(\n","  optimizer = 'adam',\n","  loss = 'binary_crossentropy',\n","  metrics = list('accuracy')\n",")"]},{"cell_type":"markdown","metadata":{"papermill":{"duration":0.066924,"end_time":"2022-07-20T11:49:01.274482","exception":false,"start_time":"2022-07-20T11:49:01.207558","status":"completed"},"tags":[]},"source":["**Create a validation set**\n","\n","When training, we want to check the accuracy of the model on data it hasn‚Äôt seen before. Create a validation set by setting apart 10,000 examples from the original training data. (Why not use the testing set now? Our goal is to develop and tune our model using only the training data, then use the test data just once to evaluate our accuracy)."]},{"cell_type":"code","execution_count":42,"metadata":{"execution":{"iopub.execute_input":"